        public ActionResult ViewStatement(string strLNumber)
        {
            //************chkeck if loan applicaiton number belons to this user
            LoanAPI.TClientEnquiryReply clientReply = new LoanAPI.TClientEnquiryReply();
            using (var proxy = new LoanAPI.FINBONDAPIClient())
            {
                wLogger.Info("ClientEnquiry request");
                clientReply = proxy.ClientEnquiry(Common.getClientSessionData(), Common.LoggedInClientIDNumber, false);
                wLogger.Info("ClientEnquiry response" + JsonConvert.SerializeObject(clientReply));
                if(clientReply!=null && clientReply.ReplyData.ReplyCode==1)
                {
                    var data = clientReply.ExistingLoanData.ToList().Where(m => m.ContractNumber.ToString() == Common.Decrypt ( strLNumber,true));
                    if(data!=null )
                    {
                        //**************application number exists
                        string strLoanApplicationNumber = Common.Decrypt(strLNumber, true);
                        //**********************get html**************************
                        StringBuilder str = new StringBuilder("");
                        //str.Append("<div>hellow world </div>");
                        str.Append(GenerateHTMLStatement(strLNumber, clientReply, data.FirstOrDefault()));
                        //***************************convert html to pdf***************************

                        //*****************convert pdf to byte array
                        byte[] pdfBytes = GeneratePDFFrmJ(str.ToString());
                        string strFileName = "StatementDocument-" + DateTime.Now.ToString("ddMMyyyyHHmmss") + ".pdf";
                        System.Web.HttpResponse response = System.Web.HttpContext.Current.Response;
                        response.Clear();
                        response.AddHeader("Content-Type", "application/pdf");


                        response.AddHeader("Content-Disposition", String.Format("inline; filename=" + strFileName +
                        "; size={0}", pdfBytes.Length.ToString()));

                        response.BinaryWrite(pdfBytes);
                        response.End();
                        return File(pdfBytes, "application/pdf");
                    }
                    else
                    {
                        return RedirectToAction("index", "home");
                    }
                }
                else
                {
                    return RedirectToAction("index", "home");
                }
            }
            return RedirectToAction("index", "home");
        }

